{"source":{"uri":"features/specs/PesquisaAvancada/PesquisaAvancada.feature","data":"#language: pt\n\nFuncionalidade: Pesquisa Avançada\n\n    Funcionalidade de pesquisa avancada \n\n    @pesquisaAvancada_CEP\n    Cenário: Busca avançada por CEP DEVE retornar resultados\n        Dado que o usuário esteja na página de Busca Rede\n        Quando pesquisa avançada é selecionada\n        E o valor de CEP é preenchido com \"22041011\" na pesquisa avancada        \n        E quando é realizada uma pesquisa avancada  \n        Então o sistema DEVE retornar uma lista de resultados da busca","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/PesquisaSimples/PesquisaSimples.feature","data":"#language: pt\n\nFuncionalidade: Pesquisa Simples\n\n    Funcionalidade de pesquisa simples \n    \n    @pesquisaSimples\n    Cenário: Busca simples por Estado e Cidade DEVE retornar resultados\n        Dado que o usuário esteja na página de Busca Rede\n        Quando o valor de estado é preenchido com \"São Paulo\"\n        E o valor de cidade é preenchido com \"São Paulo\"           \n        E quando é realizada uma pesquisa simples  \n        Então o sistema DEVE retornar uma lista de resultados da busca\n\n    @pesquisaSimples_validando_resultados\n    Cenário: Busca simples por Estado e Cidade DEVE retornar resultados\n        Dado que o usuário esteja na página de Busca Rede\n        Quando o valor de estado é preenchido com \"Rio de Janeiro\"\n        E o valor de cidade é preenchido com \"Rio de Janeiro\"           \n        E quando é realizada uma pesquisa simples  \n        Então o sistema DEVE retornar uma lista com \"4.480\" resultados\n\n    @pesquisaSimples_enviando_plano\n    Cenário: Busca simples por Estado e Cidade DEVE retornar resultados\n        Dado que o usuário esteja na página de Busca Rede\n        Quando o valor de estado é preenchido com \"São Paulo\"\n        E o valor de cidade é preenchido com \"São Paulo\" \n        E o plano selecionado é \"AMS\"          \n        E quando é realizada uma pesquisa simples  \n        Então o sistema DEVE retornar uma lista com \"1.032\" resultados","mediaType":"text/x.cucumber.gherkin+plain"}},
